import React from 'react';
import banner from '../../assets/images/banners/bannerMain.png';

export default function Product(){
    return(
        <div className="main">
            <section className="banner">
                <div className="image-des" style={{backgroundColor: 'red', height: '1000px'}}>
                    <img src={banner} alt=""></img>
                </div>
            </section>
            <div className="overlay">

            </div>

        </div>

    );

}
